import React, { Component } from 'react';


class Fish extends Component {
    render() {
        const props = this.props;
        return (
            <li className="menu-fish">
                <img src={props.details.image} alt={props.details.name} />
                <h3 className="fish-name">
                    {props.details.name}
                </h3>
            </li>
        );
    }
}

export default Fish;
